DROP TABLE IF EXISTS `notes`;
CREATE TABLE `notes`  (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `title` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '笔记标题',
  `content` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '笔记内容(富文本)',
  `description` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '笔记简介',
  `subject_id` int NOT NULL COMMENT '学科分类ID',
  `note_type_id` int NOT NULL COMMENT '笔记类型ID',
  `user_id` bigint NOT NULL COMMENT '作者ID',
  `views` int NULL DEFAULT 0 COMMENT '浏览量',
  `likes` int NULL DEFAULT 0 COMMENT '点赞数',
  `favorites` int NULL DEFAULT 0 COMMENT '收藏数',
  `rating` decimal(3, 2) NULL DEFAULT 0.00 COMMENT '评分(0-5分)',
  `rating_count` int NULL DEFAULT 0 COMMENT '评分人数',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `status` tinyint NULL DEFAULT 1 COMMENT '状态: 1-正常, 0-下架',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_subject_id`(`subject_id` ASC) USING BTREE,
  INDEX `idx_note_type_id`(`note_type_id` ASC) USING BTREE,
  INDEX `idx_user_id`(`user_id` ASC) USING BTREE,
  INDEX `idx_created_at`(`created_at` ASC) USING BTREE,
  INDEX `idx_views`(`views` ASC) USING BTREE,
  INDEX `idx_rating`(`rating` ASC) USING BTREE,
  INDEX `idx_subject_type`(`subject_id` ASC, `note_type_id` ASC) USING BTREE,
  CONSTRAINT `notes_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE RESTRICT,
  CONSTRAINT `notes_ibfk_2` FOREIGN KEY (`subject_id`) REFERENCES `subjects` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `notes_ibfk_3` FOREIGN KEY (`note_type_id`) REFERENCES `note_types` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 15 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '笔记表' ROW_FORMAT = DYNAMIC;

-- ----------------------------
-- Records of notes
-- ----------------------------
INSERT INTO `notes` VALUES (1, '笔记1：计算机基础', '<h2>计算机基础笔记</h2>\r\n\r\n<p><strong>第一章：计算机组成原理</strong></p>\r\n<ul>\r\n  <li>计算机由硬件和软件组成</li>\r\n  <li>硬件包括 CPU、内存、输入输出设备</li>\r\n  <li>软件分为系统软件和应用软件</li>\r\n</ul>\r\n\r\n<p><em>重点：</em>冯·诺依曼结构是现代计算机的基本模型。</p>\r\n\r\n<p>下面是计算机结构示意图：</p>\r\n\r\n<p>\r\n  <img src=\"data:image/png;base64,\"/>\r\n</p>\r\n\r\n<p><strong>第二章：操作系统基础</strong></p>\r\n<ol>\r\n  <li>操作系统是管理计算机硬件与软件资源的系统软件。</li>\r\n  <li>常见操作系统：Windows、Linux、macOS。</li>\r\n</ol>\r\n\r\n<p><u>总结：</u>计算机基础包括硬件结构、操作系统和软件应用，是学习计算机的核心起点。</p>\r\n', '简介1', 1, 1, 1, 158, 21, 11, 4.50, 2, '2025-09-26 11:15:00', '2025-09-29 09:08:24', 1);
INSERT INTO `notes` VALUES (2, '笔记2：数学分析', '这是数学分析的笔记内容...', '数学分析笔记', 2, 2, 2, 151, 30, 15, 4.00, 3, '2025-09-12 11:20:00', '2025-09-29 08:42:52', 1);
