-- ----------------------------
-- View structure for note_detail_view
-- ----------------------------
DROP VIEW IF EXISTS `note_detail_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `note_detail_view` AS select `n`.`id` AS `id`,`n`.`title` AS `title`,`n`.`content` AS `content`,`n`.`description` AS `description`,`s`.`code` AS `subject_code`,`s`.`name` AS `subject_name`,`nt`.`code` AS `note_type_code`,`nt`.`name` AS `note_type_name`,`n`.`subject_id` AS `subject_id`,`n`.`note_type_id` AS `note_type_id`,`n`.`views` AS `views`,`n`.`likes` AS `likes`,`n`.`favorites` AS `favorites`,`n`.`rating` AS `rating`,`n`.`rating_count` AS `rating_count`,`n`.`created_at` AS `created_at`,`n`.`updated_at` AS `updated_at`,`u`.`id` AS `author_id`,`u`.`username` AS `author_username`,`u`.`nickname` AS `author_nickname`,`u`.`avatar` AS `author_avatar`,`u`.`school` AS `author_school`,`u`.`major` AS `author_major`,(select count(0) from `comments` where ((`comments`.`note_id` = `n`.`id`) and (`comments`.`status` = 1))) AS `comment_count`,(select `note_images`.`image_url` from `note_images` where (`note_images`.`note_id` = `n`.`id`) order by `note_images`.`image_order` limit 1) AS `first_image` from (((`notes` `n` join `users` `u` on((`n`.`user_id` = `u`.`id`))) join `subjects` `s` on((`n`.`subject_id` = `s`.`id`))) join `note_types` `nt` on((`n`.`note_type_id` = `nt`.`id`))) where ((`n`.`status` = 1) and (`u`.`status` = 1) and (`s`.`status` = 1) and (`nt`.`status` = 1));

-- ----------------------------
-- View structure for note_details
-- ----------------------------
DROP VIEW IF EXISTS `note_details`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `note_details` AS select `n`.`id` AS `id`,`n`.`title` AS `title`,`n`.`description` AS `description`,`n`.`file_url` AS `file_url`,`n`.`file_type` AS `file_type`,`n`.`course_name` AS `course_name`,`n`.`tags` AS `tags`,`n`.`view_count` AS `view_count`,`n`.`download_count` AS `download_count`,`n`.`like_count` AS `like_count`,`n`.`collect_count` AS `collect_count`,`n`.`created_at` AS `created_at`,`u`.`nickname` AS `author_name`,`u`.`avatar` AS `author_avatar`,`c`.`name` AS `category_name` from ((`notes` `n` left join `users` `u` on((`n`.`user_id` = `u`.`id`))) left join `categories` `c` on((`n`.`category_id` = `c`.`id`))) where (`n`.`status` = 1);

-- ----------------------------
-- View structure for user_stats_view
-- ----------------------------
DROP VIEW IF EXISTS `user_stats_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `user_stats_view` AS select `u`.`id` AS `id`,`u`.`username` AS `username`,`u`.`nickname` AS `nickname`,`u`.`avatar` AS `avatar`,`u`.`school` AS `school`,`u`.`major` AS `major`,count(distinct `n`.`id`) AS `note_count`,count(distinct `uf`.`id`) AS `favorite_count`,count(distinct `c`.`id`) AS `comment_count`,coalesce(sum(`n`.`views`),0) AS `total_views`,coalesce(sum(`n`.`likes`),0) AS `total_likes` from (((`users` `u` left join `notes` `n` on(((`u`.`id` = `n`.`user_id`) and (`n`.`status` = 1)))) left join `user_favorites` `uf` on((`u`.`id` = `uf`.`user_id`))) left join `comments` `c` on(((`u`.`id` = `c`.`user_id`) and (`c`.`status` = 1)))) where (`u`.`status` = 1) group by `u`.`id`,`u`.`username`,`u`.`nickname`,`u`.`avatar`,`u`.`school`,`u`.`major`;

SET FOREIGN_KEY_CHECKS = 1;
